import classes from './NoticeBoardToolBar.module.css';
import {BsTelegram, BsArrowLeft} from 'react-icons/bs';


const NoticeBoardToolBar =() =>{

return(

<div className={classes.noticeBoardToolBar}>


<button className={classes.noticeBoardButton}><BsArrowLeft className={classes.backArrow}/>  </button>

<button className={classes.noticeBoardButton}> Unread: 2 </button>

<button className={classes.noticeBoardButton}> <BsTelegram className={classes.postNoticeIcon}/> </button>	


</div>	

);

}

export default NoticeBoardToolBar;
